import React, { Component } from 'react'
import './style.css'

class Navbar extends Component {

    renderEmailForm  ()  {
        if (this.props.emailForm === false ){}
    }

    render() {
        return (
        <div>
            <div id='navbar'>
                <h1 className="header">Certified Atms</h1>
                <span className="tabs">Home |</span>
                <button className="tabs" onClick={this.props.emailForm}>Email |</button>
            </div>
        </div>
        )
    }
}



export default Navbar;
